import "./MonsterList.style.css";
import { Card} from "react-bootstrap";
const MonsterPopularCard = ({name='',description='',img=''}) => {
    //     id: 1,
    //     name: "هیولای آنتن دار",
    //     username:"zahraaa",
    //     website: "قشنگترین هیولای آنتنی جهانم"
    // },
    //     {
    //         id: 1,
    //         name: "هیولای استقلالی",
    //         username:"Reza",
    //         website: "هیولای استقلالی هستم"
    //     },
    //     {
    //         id: 1,
    //         name: "هیولای مو قشنگ",
    //         username:"masi",
    //         website: "هیولایی با دنیای صورتی "
    //     },
    //
    return(
        <div className="monster-card">
            <Card style={{ width: '15rem' }}>
                <Card.Img variant="top" src={img} />
                <Card.Body>
                    <Card.Title>{name}</Card.Title>
                    <Card.Text>
                        {description}
                    </Card.Text>
                </Card.Body>
            </Card>
        </div>
    )
}

export default MonsterPopularCard;
